import React from 'react';
import './ModalBackdrop.css';

 const ModalBackdrop = (props)=>{
  let style = {
    position:'absolute',
    zIndex:'500',
    top:'0',
    left:'0',
    right:'0',
    bottom:'0',
    background:'rgba(0,0,0,0.3)'
  }

  return(
    <div style = {style}>
    </div>
  )
}

export default ModalBackdrop;
